import React, {Component} from 'react';
import {Container, Row, Col, Button} from 'react-bootstrap';
import '././css/Stock.css';
import './countryList.js';


class Stock extends Component {
	test(){
		alert('successful');
	}
	render(){
		return(
			<div>
				<h className ="title"> United States Stocks </h>

				<Container className = "filter-title">
					<Row>
						<Col> 
							Market 
								<div className = "filter" onClick ={this.test}> United States &#9660; </div>

	<div style={{ margin: 15, marginLeft: 35 }}>
        <div style={{ display: 'flex', flexDirection: 'row' }}>


			<div style={{overflow: 'scroll', height: 'inherit', display: 'block', maxWidth: 300, marginLeft: 20,}}>
                <li> Item visible</li>
                <li> Item visible</li>
                <li> Item visible</li>
                <li> Item NOT visible</li>
                <li> Item NOT visible</li>
                <li> Item NOT visible</li>
                <li> Item NOT visible</li>
            </div>
        </div>
    </div>

						</Col>
						<Col> 
							Industry 
							<div className = "filter"> Technology &#9660; </div>
						</Col>
						<Col className ='more-filter'> More Filters </Col>
					</Row>
				</Container>
			</div>

		);
	}
}

export default Stock;
